    box-shadow: none;
  }
}

// Form layout
//== Horizontal Form
.@{form-prefix-cls}-horizontal {
  .@{form-prefix-cls}-item {
    .make-row;
  }

  .@{ant-prefix}-radio-inline,
  .@{ant-prefix}-checkbox-inline {
    vertical-align: baseline;
  }
}

// Form layout
//== Vertical Form
.@{form-prefix-cls}-vertical {
  .@{form-prefix-cls}-item-label {
    padding: 0 0 8px;

    label:after {
      content: '';
    }
  }
}

//== Inline Form
.@{form-prefix-cls}-inline {
  .@{form-prefix-cls}-item {
    display: inline-block;
    margin-right: 10px;
    margin-bottom: 0;

    &-with-help {
      margin-bottom: 24px;
    }

    > div {
      display: inline-block;
    }
  }

  .@{form-prefix-cls}-text {
    display: inline-block;
  }

  .has-feedback {
    display: inline-block;
  }

  // Fix https://github.comdesigndesign/issues/1040
  .@{form-prefix-cls}-explain {
    position: absolute;
  }
}

.@{form-prefix-cls}-horizontal,
.@{form-prefix-cls}-inline {
  label {
    > input[type="radio"],
    > input[type="checkbox"] {
      margin-right: 4px;
    }
  }
}

// Validation state
.has-success,
.has-warning,
.has-error,
.is-validating {
  &.has-feedback:after {
    position: absolute;
    top: 0;
    right: 0;
    visibility: visible;
    .square(@input-height-lg);
    line-height: @input-height-lg;
    text-align: center;
    font-size: 14px;
    animation: zoomIn .3s @ease-out-back;
    .iconfont-font("");
  }
}

.has-success {
  &.has-feedback:after {
    animation-name: diffZoomIn1 !important;
  }
}

.has-error {
  &.has-feedback:after {
    animation-name: diffZoomIn2 !important;
  }
}

.has-warning {
  &.has-feedback:after {
    animation-name: diffZoomIn3 !important;
  }
}

.has-success {
  .@{ant-prefix}-input {
    border-color: @input-border-color;
    box-shadow: none;
  }

  &.has-feedback:after {
    content: '\e630';
    color: @success-color;
  }
}

.has-warning {
  .form-control-validation(@warning-color; @warning-color;);

  &.has-feedback:after {
    content: '\e62c';
    color: @warning-color;
  }

  //select
  .@{ant-prefix}-select {
    &-selection {
      border-color: @warning-color;
      .active(@warning-color);
    }
    &-arrow {
      color: @warning-color;
    }
  }

  //datepicker
  .@{ant-prefix}-calendar-picker-icon:after {
    color: @warning-color;
  }

  //timepicker
  .@{ant-prefix}-time-picker-icon:after {
    color: @warning-color;
  }

  //input-number, timepicker
  .@{ant-prefix}-input-number,
  .@{ant-prefix}-time-picker-input {
    border-color: @warning-color;
    .active(@warning-color);
    &:not([disabled]):hover {
      border-color: @warning-color;
    }
  }
}

.has-error {
  .form-control-validation(@error-color; @error-color;);

  &.has-feedback:after {
    content: '\e62e';
    color: @error-color;
  }

  //select
  .@{ant-prefix}-select {
    &-selection {
      border-color: @error-color;
      .active(@error-color);
    }

    &-arrow {
      color: @error-color;
    }
  }

  //datepicker
  .@{ant-prefix}-calendar-picker-icon:after {
    color: @error-color;
  }

  //timepicker
  .@{ant-prefix}-picker-icon:after {
    color: @error-color;
  }

  //input-number, timepicker
  .@{ant-prefix}-input-number,
  .@{ant-prefix}-time-picker-input {
    border-color: @error-color;
    .active(@error-color);
    &:not([disabled]):hover {
      border-color: @error-color;
    }
  }
  .@{ant-prefix}-mention-wrapper,
  .@{ant-prefix}-mention-wrapper.active {
    .@{ant-prefix}-mention-editor {
      border-color: @error-color;
      .active(@error-color);
      &:not([disabled]):hover,
      &:not([disabled]):focus {
        border-color: @error-color;
        .active(@error-color);
      }
    }
  }
}

.is-validating {
  &.has-feedback:after {
    display: inline-block;
    animation: loadingCircle 1s infinite linear;
    content: "\e6ae";
    color: #999;
  }
}

.@{ant-prefix}-advanced-search-form {
  .@{form-prefix-cls}-item {
    margin-bottom: 16px;
  }
  .@{ant-prefix}-input,
  .@{ant-prefix}-input-group .@{ant-prefix}-input,
  .@{ant-prefix}-input-group .@{ant-prefix}-input-group-addon {
    height: 28px;
  }
}

// need there different zoom animation
// otherwise won't trigger anim
@keyframes diffZoomIn1 {
  0% {
    transform: scale(0);
  }
  100% {
    transform: scale(1);
  }
}

@keyframes diffZoomIn2 {
  0% {
    transform: scale(0);
  }
  100% {
    transform: scale(1);
  }
}

@keyframes diffZoomIn3 {
  0% {
    transform: scale(0);
  }
  100% {
    transform: scale(1);
  }
}
