"// Prefix
@ant-prefix             : ant;

// Color
@primary-color          : #2db7f5;
@info-color             : #2db7f5;
@success-color          : #87d068;
@error-color            : #f50;
@warning-color          : #fa0;
@normal-color           : #d9d9d9;

// ------ Base & Require ------
@body-background        : #fff;
@font-family            : -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Helvetica, "PingFang SC", "Hiragino Sans GB", "Microsoft YaHei", SimSun, sans-serif;
@code-family            : Consolas,Menlo,Courier,monospace;
@text-color             : #666;
@heading-color          : #404040;
@font-size-base         : 12px;
@line-height-base       : 1.5;
@line-height-computed   : floor((@font-size-base * @line-height-base));
@border-radius-base     : 6px;
@border-radius-sm       : 4px;

// ICONFONT
@iconfont-css-prefix    : anticon;
@icon-url               : "https://at.alicdn.com/t/font_1473840929_824008";

// LINK
@link-color             : #2db7f5;
@link-hover-color       : tint(@link-color, 20%);
@link-active-color      : shade(@link-color, 5%);
@link-hover-decoration  : none;

// Disabled cursor for form controls and buttons.
@cursor-disabled        : not-allowed;

// Animation
@ease-out            : cubic-bezier(0.215, 0.61, 0.355, 1);
@ease-in             : cubic-bezier(0.55, 0.055, 0.675, 0.19);
@ease-in-out         : cubic-bezier(0.645, 0.045, 0.355, 1);
@ease-out-back       : cubic-bezier(0.12, 0.4, 0.29, 1.46);
@ease-in-back        : cubic-bezier(0.71, -0.46, 0.88, 0.6);
@ease-in-out-back    : cubic-bezier(0.71, -0.46, 0.29, 1.46);
@ease-out-circ       : cubic-bezier(0.08, 0.82, 0.17, 1);
@ease-in-circ        : cubic-bezier(0.6, 0.04, 0.98, 0.34);
@ease-in-out-circ    : cubic-bezier(0.78, 0.14, 0.15, 0.86);
@ease-out-quint      : cubic-bezier(0.23, 1, 0.32, 1);
@ease-in-quint       : cubic-bezier(0.755, 0.05, 0.855, 0.06);
@ease-in-out-quint   : cubic-bezier(0.86, 0, 0.07, 1);

// Border color
@border-color-base      : #d9d9d9;        // base border outline a component
@border-color-split     : #e9e9e9;        // split border inside a component

// Outline
@outline-blur-size      : 0;
@outline-width          : 2px;
@outline-color          : @primary-color;

// Background color
@background-color-base  : #f7f7f7;        // basic gray background

// Shadow
@shadow-color           : rgba(100, 100, 100, .2);
@box-shadow-base        : @shadow-1-down;
@shadow-1-up            : 0 -1px 6px @shadow-color;
@shadow-1-down          : 0 1px 6px @shadow-color;
@shadow-1-left          : -1px 0 6px @shadow-color;
@shadow-1-right         : 1px 0 6px @shadow-color;
@shadow-2               : 0 1px 8px @shadow-color;

// Buttons
@btn-font-weight        : 500;
@btn-border-radius-base : @border-radius-base;
@btn-border-radius-sm   : @border-radius-sm;

@btn-primary-color      : #fff;
@btn-primary-bg         : @primary-color;
@btn-group-border       : shade(@primary-color, 5%);

@btn-default-color      : @text-color;
@btn-default-bg         : @background-color-base;
@btn-default-border     : @border-color-base;

@btn-ghost-color        : @text-color;
@btn-ghost-bg           : transparent;
@btn-ghost-border       : @border-color-base;

@btn-disable-color      : #ccc;
@btn-disable-bg         : @background-color-base;
@btn-disable-border     : @border-color-base;

@btn-padding-base       : 4px 15px;

@btn-font-size-lg       : 14px;
@btn-padding-lg         : 4px 15px 5px 15px;

@btn-padding-sm         : 1px 7px;

@btn-circle-size        : 28px;
@btn-circle-size-lg     : 32px;
@btn-circle-size-sm     : 22px;

// Media queries breakpoints
// Extra small screen / phone
@screen-xs              : 480px;
@screen-xs-min          : @screen-xs;
@screen-xs-max          : (@screen-xs-min - 1);

// Small screen / tablet
@screen-sm              : 768px;
@screen-sm-min          : @screen-sm;
@screen-sm-max          : (@screen-sm-min - 1);

// Medium screen / desktop
@screen-md              : 992px;
@screen-md-min          : @screen-md;
@screen-md-max          : (@screen-md-min - 1);

// Large screen / wide desktop
@screen-lg              : 1200px;
@screen-lg-min          : @screen-lg;
@screen-lg-max          : (@screen-lg-min - 1);

// Layout and Grid system
@grid-columns           : 24;
@grid-gutter-width      : 0;

// Container sizes
@container-sm           : (720px + @grid-gutter-width);
@container-md           : (940px + @grid-gutter-width);
@container-lg           : (1140px + @grid-gutter-width);

// z-index list
@zindex-affix           : 10;
@zindex-back-top        : 10;
@zindex-modal-mask      : 1000;
@zindex-modal           : 1000;
@zindex-notification    : 1010;
@zindex-message         : 1010;
@zindex-popover         : 1030;
@zindex-picker          : 1050;
@zindex-dropdown        : 1050;
@zindex-tooltip         : 1060;

// Animation
@animation-duration-slow: .3s; // Modal
@animation-duration-base: .2s;
@animation-duration-fast: .1s; // Tooltip

// Form
// ---
@legend-color                : #999;
@legend-border-color         : @border-color-base;
@label-required-color        : #f50;
@label-color                 : @text-color;
@form-item-margin-bottom     : 24px;

// Input
// ---
@input-height-base           : 28px;
@input-height-lg             : 32px;
@input-height-sm             : 22px;
@input-padding-horizontal    : 7px;
@input-padding-vertical-base : 4px;
@input-padding-vertical-sm   : 1px;
@input-padding-vertical-lg   : 6px;
@input-placeholder-color     : #ccc;
@input-color                 : @text-color;
@input-border-color          : @border-color-base;
@input-bg                    : #fff;
@input-hover-border-color    : @primary-color;
@input-disabled-bg           : @background-color-base;

// Tooltip
// ---
//* Tooltip max width
@tooltip-max-width: 250px;
//** Tooltip text color
@tooltip-color: #fff;
//** Tooltip background color
@tooltip-bg: rgba(64, 64, 64, .85);
//** Tooltip arrow width
@tooltip-arrow-width: 5px;
//** Tooltip distance with trigger
@tooltip-distance: @tooltip-arrow-width - 1 + 4;
//** Tooltip arrow color
@tooltip-arrow-color: @tooltip-bg;

// Popover
// ---
//** Popover body background color
@popover-bg: #fff;
//** Popover maximum width
@popover-min-width: 177px;
//** Popover border color
@popover-border-color: @border-color-base;
//** Popover arrow width
@popover-arrow-width: 4px;
//** Popover arrow color
@popover-arrow-color: @popover-bg;
//** Popover outer arrow width
@popover-arrow-outer-width: (@popover-arrow-width + 1);
//** Popover outer arrow color
@popover-arrow-outer-color: fadein(@popover-border-color, 5%);
"

"@import "../../style/themes/default";
@import "../../style/mixins/index";

@switch-prefix-cls: ~"@{ant-prefix}-switch";
@switch-duration: .3s;

.@{switch-prefix-cls} {
  position: relative;
  display: inline-block;
  box-sizing: border-box;
  width: 44px;
  height: 22px;
  line-height: 20px;
  vertical-align: middle;
  border-radius: 20px;
  border: 1px solid #ccc;
  background-color: #ccc;
  cursor: pointer;
  transition: all @switch-duration @ease-in-out-circ;
  user-select: none;

  &-inner {
    color: #fff;
    font-size: 12px;
    position: absolute;
    left: 24px;
  }

  &:after {
    position: absolute;
    width: 18px;
    height: 18px;
    left: 2px;
    top: 1px;
    border-radius: 18px;
    background-color: #fff;
    content: " ";
    cursor: pointer;
    transition: left @switch-duration @ease-in-out-circ, width @switch-duration @ease-in-out-circ;
  }

  &:active:after {
    width: 24px;
  }

  &:focus {
    box-shadow: 0 0 0 2px fade(@primary-color, 20%);
    outline: 0;
  }

  &:focus:hover {
    box-shadow: none;
  }

  &-small {
    height: 14px;
    line-height: 12px;
    width: 28px;
    &:after {
      width: 12px;
      height: 12px;
      top: 0;
      left: 0;
    }
    &:active:after {
      width: 16px;
    }
  }

  &-small&-checked:after {
    left: 14px;
  }

  &-small:active&-checked:after {
    left: 10px;
  }

  &-checked {
    border-color: @primary-color;
    background-color: @primary-color;

    .@{switch-prefix-cls}-inner {
      left: 6px;
    }

    &:after {
      left: 22px;
    }

    &:active:after {
      left: 16px;
    }
  }

  &-disabled {
    cursor: not-allowed;
    background: #f4f4f4;
    border-color: #f4f4f4;

    &:after {
      background: #ccc;
      cursor: not-allowed;
    }

    .@{switch-prefix-cls}-inner {
      color: #ccc;
    }
  }
}
"

"@import "../../style/themes/default";
@import "../../style/mixins/index";

@table-prefix-cls: ~"@{ant-prefix}-table";
@table-head-background-color: @background-color-base;

.@{table-prefix-cls} {
  font-size: @font-size-base;
  color: @text-color;
  overflow: hidden;
  position: relative;
  border-radius: @border-radius-base @border-radius-base 0 0;
  overflow: hidden;

  &-body {
    transition: opacity 0.3s ease;
  }

  table {
    width: 100%;
    border-collapse: separate;
    border-spacing: 0;
    text-align: left;
    border-radius: @border-radius-base @border-radius-base 0 0;
    overflow: hidden;
  }

  &-thead > tr > th {
    background: @table-head-background-color;
    font-weight: bold;
    transition: background .3s ease;
    text-align: left;

    .@{iconfont-css-prefix}-filter {
      margin-left: 4px;
      font-size: 12px;
      cursor: pointer;
      color: #aaa;
      transition: all 0.3s ease;
      &:hover {
        color: #666;
      }
    }

    .@{table-prefix-cls}-filter-selected.@{iconfont-css-prefix}-filter {
      color: @primary-color;
    }
  }

  &-tbody > tr > td {
    border-bottom: 1px solid @border-color-split;
  }

  &-thead > tr,
  &-tbody > tr {
    transition: all .3s ease;
    &.@{table-prefix-cls}-row-hover,
    &:hover {
      background: tint(@primary-color, 90%);
    }
  }

  &-thead > tr:hover {
    background: none;
  }

  &-footer {
    padding: 16px 8px;
    background: @table-head-background-color;
    position: relative;
    z-index: 2;
    top: -1px;
    border-radius: 0 0 @border-radius-base @border-radius-base;
  }

  &.@{table-prefix-cls}-bordered &-footer {
    border: 1px solid @border-color-split;
  }

  &-title {
    padding: 16px 8px;
    position: relative;
    top: 1px;
    border-radius: @border-radius-base @border-radius-base 0 0;
  }

  &.@{table-prefix-cls}-bordered &-title {
    border: 1px solid @border-color-split;
  }

  &-title + &-content {
    position: relative;

    table {
      border-top-left-radius: 0;
      border-top-right-radius: 0;
    }
  }

  &-tbody > tr.@{table-prefix-cls}-row-selected {
    background: #fafafa;
  }

  &-thead > tr > th.@{table-prefix-cls}-column-sort {
    background: #eaeaea;
  }

  &-thead > tr > th,
  &-tbody > tr > td {
    padding: 16px 8px;
    word-break: break-all;
  }

  &-thead > tr > th.@{table-prefix-cls}-selection-column,
  &-tbody > tr > td.@{table-prefix-cls}-selection-column {
    text-align: center;
    width: 60px;
  }

  &-header {
    background: @table-head-background-color;
    overflow: hidden;
  }

  &-header table {
    border-radius: @border-radius-base @border-radius-base 0 0;
  }

  &-loading {
    position: relative;
    .@{table-prefix-cls}-body {
      background: #fff;
      opacity: 0.5;
    }
    .@{table-prefix-cls}-spin-holder {
      height: 20px;
      line-height: 20px;
      left: 50%;
      top: 50%;
      margin-left: -30px;
      position: absolute;
    }
    .@{table-prefix-cls}-with-pagination {
      margin-top: -20px;
    }
    .@{table-prefix-cls}-without-pagination {
      margin-top: 10px;
    }
  }

  &-middle {
    .@{table-prefix-cls}-thead > tr > th,
    .@{table-prefix-cls}-tbody > tr > td {
      padding: 10px 8px;
    }
  }

  &-small {
    border: 1px solid @border-color-split;
    border-radius: @border-radius-base;

    .@{table-prefix-cls}-header > table,
    .@{table-prefix-cls}-body > table {
      border: 0;
      padding: 0 8px;
    }

    &.@{table-prefix-cls}-bordered .@{table-prefix-cls}-body > table {
      border: 0;
    }

    .@{table-prefix-cls}-thead > tr > th {
      padding: 10px 8px;
      background: #fff;
      border-bottom: 1px solid @border-color-split;
    }

    .@{table-prefix-cls}-tbody > tr > td {
      padding: 6px 8px;
    }

    .@{table-prefix-cls}-header {
      background: #fff;
      table {
        border-bottom: 1px solid @border-color-split;
      }
      .@{table-prefix-cls}-thead > tr > th {
        border-bottom: 0;
      }
    }

    .@{table-prefix-cls}-row:last-child td {
      border-bottom: 0;
    }
  }

  &-column-sorter {
    margin-left: 4px;
    display: inline-block;
    width: 12px;
    height: 14px;
    vertical-align: middle;
    text-align: center;
    &-up,
    &-down {
      line-height: 4px;
      height: 5px;
      display: block;
      width: 12px;
      cursor: pointer;
      &:hover .@{iconfont-css-prefix} {
        color: #666;
      }
      &.on {
        .@{iconfont-css-prefix}-caret-up,
        .@{iconfont-css-prefix}-caret-down {
          color: @primary-color;
        }
      }
    }
    .@{iconfont-css-prefix}-caret-up,
    .@{iconfont-css-prefix}-caret-down {
      .iconfont-size-under-12px(7px);
      line-height: 6px;
      height: 6px;
      color: #aaa;
      &:before {
        -moz-transform-origin: 53% 50%; /* fix firefox position */
      }
    }
  }

  &-bordered {
    .@{table-prefix-cls}-header > table,
    .@{table-prefix-cls}-body > table,
    .@{table-prefix-cls}-fixed-left table,
    .@{table-prefix-cls}-fixed-right table {
      border: 1px solid @border-color-split;
    }

    &.@{table-prefix-cls}-fixed-header {
      .@{table-prefix-cls}-header > table {
        border-bottom: 0;
      }

      .@{table-prefix-cls}-body > table {
        border-top: 0;
        border-top-left-radius: 0;
        border-top-right-radius: 0;
      }

      .@{table-prefix-cls}-body-inner > table {
        border-top: 0;
      }

      .@{table-prefix-cls}-placeholder {
        border-bottom: 0;
      }
    }

    .@{table-prefix-cls}-thead > tr > th {
      border-bottom: 1px solid @border-color-split;
    }

    &.@{table-prefix-cls}-empty .@{table-prefix-cls}-thead > tr > th {
      border-bottom: 0;
    }

    .@{table-prefix-cls}-tbody tr:last-child {
      > th,
      > td {
        border-bottom: 0;
      }
    }

    .@{table-prefix-cls}-thead > tr > th,
    .@{table-prefix-cls}-tbody > tr > td {
      border-right: 1px solid @border-color-split;
    }
    .@{table-prefix-cls}-thead > tr:first-child > th,
    .@{table-prefix-cls}-tbody > tr > td {
      &:last-child {
        border-right: 0;
      }
    }
  }

  &-placeholder {
    padding: 16px 8px;
    background: #fff;
    border-bottom: 1px solid @border-color-split;;
    text-align: center;
    position: relative;
    z-index: 2;
    font-size: 12px;
    color: #999;
    .@{iconfont-css-prefix} {
      margin-right: 4px;
    }
  }

  &-pagination {
    margin: 16px 0;
    float: right;
  }

  &-filter-dropdown {
    min-width: 96px;
    margin-left: -8px;
    background: #fff;
    border-radius: @border-radius-base;
    border: 1px solid @border-color-base;
    box-shadow: @box-shadow-base;

    .@{ant-prefix}-dropdown-menu {
      border: 0;
      box-shadow: none;
      border-radius: @border-radius-base @border-radius-base 0 0;

      &-item > label + span {
        margin-left: 8px;
      }

      &-sub {
        border-radius: @border-radius-base;
        border: 1px solid @border-color-base;
        box-shadow: @box-shadow-base;
      }

      .@{ant-prefix}-dropdown-submenu-contain-selected {
        .@{ant-prefix}-dropdown-menu-submenu-title:after {
          color: @primary-color;
          font-weight: bold;
          text-shadow: 0 0 2px tint(@primary-color, 80%);
        }
      }
    }

    .@{ant-prefix}-dropdown-menu-item {
      overflow: hidden;
    }

    > .@{ant-prefix}-dropdown-menu > .@{ant-prefix}-dropdown-menu-item:last-child,
    > .@{ant-prefix}-dropdown-menu > .@{ant-prefix}-dropdown-menu-submenu:last-child .@{ant-prefix}-dropdown-menu-submenu-title {
      border-radius: 0;
    }

    &-btns {
      overflow: hidden;
      padding: 7px 15px;
      border-top: 1px solid @border-color-split;
    }

    &-link {
      color: @link-color;
      &:hover {
        color: @link-hover-color;
      }
      &:active {
        color: @link-active-color;
      }
      &.confirm {
        float: left;
      }
      &.clear {
        float: right;
      }
    }
  }

  &-expand-icon-th {
    width: 34px;
  }

  &-row {
    &-expand-icon {
      cursor: pointer;
      display: inline-block;
      width: 17px;
      height: 17px;
      text-align: center;
      line-height: 14px;
      border: 1px solid @border-color-split;
      user-select: none;
      background: #fff;
      &-cell {
        width: 18px;
      }
    }

    &-expanded:after {
      content: '-';
    }

    &-collapsed:after {
      content: '+';
    }

    &-spaced {
      visibility: hidden;
      &:after {
        content: '.';
      }
    }

    &[class*="@{table-prefix-cls}-row-level-0"] .@{table-prefix-cls}-selection-column > span {
      display: inline-block;
    }
  }

  tr&-expanded-row {
    &,
    &:hover {
      background: #fbfbfb;
    }
  }

  .@{table-prefix-cls}-row-indent + .@{table-prefix-cls}-row-expand-icon {
    margin-right: 8px;
  }

  &-scroll {
    overflow: auto;
    table {
      width: auto;
      min-width: 100%;
    }
  }

  &-body-inner {
    height: 100%;
  }

  &-fixed-header &-body {
    position: relative;
    background: #fff;
  }

  &-fixed-header &-body-inner {
    overflow: scroll;
  }

  &-fixed-header &-scroll &-header {
    overflow: scroll;
    padding-bottom: 20px;
    margin-bottom: -20px;
  }

  &-fixed-left,
  &-fixed-right {
    position: absolute;
    top: 0;
    overflow: hidden;
    z-index: 1;
    transition: box-shadow .3s ease;
    border-radius: 0;
    table {
      width: auto;
      background: #fff;
    }
  }

  &-fixed-header &-fixed-left &-body-outer &-fixed,
  &-fixed-header &-fixed-right &-body-outer &-fixed {
    border-radius: 0;
  }

  &-fixed-left {
    left: 0;
    box-shadow: @shadow-1-right;
    .@{table-prefix-cls}-header {
      overflow-y: hidden;
    }
    // hide scrollbar in left fixed columns
    .@{table-prefix-cls}-body-inner {
      margin-right: -20px;
      padding-right: 20px;
    }
    .@{table-prefix-cls}-fixed-header & .@{table-prefix-cls}-body-inner {
      padding-right: 0;
    }
    &,
    table {
      border-radius: @border-radius-base 0 0 0;
    }
  }

  &-fixed-right {
    right: 0;
    box-shadow: @shadow-1-left;
    &,
    table {
      border-radius: 0 @border-radius-base 0 0;
    }
    // hide expand row content in right-fixed Table
    // https://github.com/ant-design/ant-design/issues/1898
    .@{table-prefix-cls}-expanded-row {
      color: transparent;
      pointer-events: none;
    }
  }

  &&-scroll-position-left &-fixed-left {
    box-shadow: none;
  }

  &&-scroll-position-right &-fixed-right {
    box-shadow: none;
  }
}
"

"@import "../../style/themes/default";
@import "../../style/mixins/index";

@tab-prefix-cls: ~"@{ant-prefix}-tabs";

.@{tab-prefix-cls} {
  box-sizing: border-box;
  position: relative;
  overflow: hidden;
  .clearfix;
  color: @text-color;

  &-bar {
    outline: none;
  }

  &-ink-bar {
    z-index: 1;
    position: absolute;
    left: 0;
    bottom: 1px;
    box-sizing: border-box;
    height: 2px;
    background-color: @primary-color;
    transition: transform 0.3s @ease-in-out;
    transform-origin: 0 0;
  }

  &-bar {
    border-bottom: 1px solid @border-color-base;
    margin-bottom: 16px;
  }

  &-nav-container {
    overflow: hidden;
    font-size: 14px;
    line-height: @line-height-base;
    box-sizing: border-box;
    position: relative;
    white-space: nowrap;
    margin-bottom: -1px;
    .clearfix;
  }

  &-nav-container-scrolling {
    padding-left: 32px;
    padding-right: 32px;
  }

  &-tab-prev,
  &-tab-next {
    user-select: none;
    z-index: 2;
    margin-right: -2px;
    margin-top: 3px;
    width: 32px;
    height: 100%;
    line-height: 32px;
    cursor: pointer;
    border: 0;
    background-color: transparent;
    position: absolute;
    text-align: center;
    color: #999;
    transition: color 0.3s ease;

    &:hover {
      color: #666;
    }

    &-icon {
      position: relative;
      display: inline-block;
      font-style: normal;
      font-weight: bold;
      font-variant: normal;
      line-height: inherit;
      vertical-align: baseline;
      text-align: center;
      text-transform: none;
      font-family: sans-serif;
      .iconfont-size-under-12px(10px);

      &:before {
        display: block;
        font-family: "anticon" !important;
      }
    }
  }

  &-tab-btn-disabled {
    cursor: not-allowed;
    &,
    &:hover {
      color: #ccc;
    }
  }

  &-tab-next {
    right: 2px;

    &-icon:before {
      content: "\e61f";
    }
  }

  &-tab-prev {
    left: 0;
    &-icon:before {
      content: "\e620";
    }
    :root & {
      filter: none;
    }
  }

  &-nav-wrap {
    overflow: hidden;
    margin-bottom: -1px;
  }

  &-nav-scroll {
    overflow: hidden;
    white-space: nowrap;
  }

  &-nav {
    box-sizing: border-box;
    padding-left: 0;
    transition: transform 0.5s @ease-in-out;
    position: relative;
    margin: 0;
    list-style: none;
    float: left;

    &:before,
    &:after {
      display: table;
      content: " ";
    }

    &:after {
      clear: both;
    }

    .@{tab-prefix-cls}-tab-disabled {
      pointer-events: none;
      cursor: default;
      color: #ccc;
    }

    .@{tab-prefix-cls}-tab {
      display: inline-block;
      height: 100%;
      margin-right: 24px;
      box-sizing: border-box;
      position: relative;

      padding: 8px 20px;
      transition: color 0.3s @ease-in-out;
      cursor: pointer;
      text-decoration: none;

      &:hover {
        color: tint(@primary-color, 20%);
      }

      &:active {
        color: shade(@primary-color, 5%);
      }
      .@{iconfont-css-prefix} {
        width: 14px;
        height: 14px;
        margin-right: 8px;
      }
    }

    .@{tab-prefix-cls}-tab-active {
      color: @primary-color;
    }
  }

  &-mini &-nav-container {
    font-size: 12px;
  }

  &-mini &-tab {
    margin-right: 0;
    padding: 8px 16px;
  }

  &:not(&-vertical) {
    .@{tab-prefix-cls}-content-animated {
      display: flex;
      flex-direction: row;
      will-change: transform;
      transition: transform 0.3s @ease-in-out;
    }

    .@{tab-prefix-cls}-tabpane {
      flex-shrink: 0;
      width: 100%;
    }
  }

  &-vertical {
    > .@{tab-prefix-cls}-bar {
      border-bottom: 0;

      .@{tab-prefix-cls}-tab {
        float: none;
        margin-right: 0;
        margin-bottom: 16px;
        display: block;
        padding: 8px 24px;

        &:last-child {
          margin-bottom: 0;
        }
      }

      .@{tab-prefix-cls}-nav-scroll {
        width: auto;
      }

      .@{tab-prefix-cls}-nav-container {
        margin-bottom: 0;
      }

      .@{tab-prefix-cls}-nav-wrap {
        margin-bottom: 0;
      }

      .@{tab-prefix-cls}-ink-bar {
        width: 2px;
        left: auto;
        height: auto;
        top: 0;
      }
    }

    > .@{tab-prefix-cls}-content {
      overflow: hidden;
      width: auto;
    }
  }

  &-vertical&-left {
    > .@{tab-prefix-cls}-bar {
      float: left;
      border-right: 1px solid @border-color-split;
      margin-right: -1px;
      margin-bottom: 0;
      .@{tab-prefix-cls}-tab {
        text-align: right;
      }
      .@{tab-prefix-cls}-nav-container {
        margin-right: -1px;
      }
      .@{tab-prefix-cls}-nav-wrap {
        margin-right: -1px;
      }
      .@{tab-prefix-cls}-ink-bar {
        right: 1px;
      }
    }
    > .@{tab-prefix-cls}-content {
      padding-left: 24px;
      border-left: 1px solid @border-color-split;
    }
  }

  &-vertical&-right {
    > .@{tab-prefix-cls}-bar {
      float: right;
      border-left: 1px solid @border-color-split;
      margin-left: -1px;
      margin-bottom: 0;
      .@{tab-prefix-cls}-nav-container {
        margin-left: -1px;
      }
      .@{tab-prefix-cls}-nav-wrap {
        margin-left: -1px;
      }
      .@{tab-prefix-cls}-ink-bar {
        left: 1px;
      }
    }
    > .@{tab-prefix-cls}-content {
      padding-right: 24px;
      border-right: 1px solid @border-color-split;
    }
  }

  &-bottom > &-bar {
    margin-bottom: 0;
    margin-top: 16px;
  }

  // card style
  &&-card > &-bar &-nav-container {
    height: 36px;
  }
  &&-card > &-bar &-ink-bar {
    visibility: hidden;
  }
  &&-card > &-bar &-tab {
    margin: 0;
    border: 1px solid @border-color-base;
    border-bottom: 0;
    border-radius: 6px 6px 0 0;
    transition: all 0.3s @ease-in-out;
    background: #f9f9f9;
    margin-right: 2px;
  }
  &&-card > &-bar &-tab {
    padding: 7px 16px 6px;
    transition: all 0.3s @ease-in-out;
  }
  &&-card > &-bar &-tab-active {
    background: #fff;
    transform: translateZ(0);
    border-color: @border-color-base;
    color: @primary-color;
  }
  &&-card > &-bar &-tab-active {
    padding-bottom: 7px;
    transform: translateZ(0);
  }
  &&-card > &-bar &-nav-wrap {
    margin-bottom: 0;
  }
  &&-card > &-bar &-tab .@{iconfont-css-prefix}-close {
    margin-right: 0;
    color: #999;
    transition: all 0.3s @ease-in-out;
    .iconfont-size-under-12px(9px);
    transform-origin: 100% 50%;
    width: 0;
    text-align: right;
    vertical-align: middle;
    overflow: hidden;
    &:hover {
      color: #404040;
      font-weight: bold;
    }
  }

  &&-editable-card > &-bar &-tab:not(&-tab-active):hover {
    padding-left: 8px;
    padding-right: 8px;
  }

  &&-card > &-bar &-tab-active .@{iconfont-css-prefix}-close,
  &&-card > &-bar &-tab:hover .@{iconfont-css-prefix}-close {
    width: 16px;
    transform: translateZ(0);
  }

  &-extra-content {
    float: right;
    line-height: 32px;

    .@{tab-prefix-cls}-new-tab {
      width: 20px;
      height: 20px;
      line-height: 20px;
      text-align: center;
      cursor: pointer;
      border-radius: 3px;
      border: 1px solid @border-color-base;
      font-size: 12px;
      .iconfont-size-under-12px(10px);
      color: #999;
      transition: color 0.3s ease;
      &:hover {
        color: #404040;
      }
    }
  }
}

.no-flex,
.@{tab-prefix-cls}-no-animation,
.@{tab-prefix-cls}-vertical {
  .@{tab-prefix-cls}-content {
    &-animated {
      transform: none!important;
    }

    > .@{tab-prefix-cls}-tabpane-inactive {
      display: none;
    }
  }
}
"

"@import "../../style/themes/default";
@import "../../style/mixins/index";

@tag-prefix-cls: ~"@{ant-prefix}-tag";

.@{tag-prefix-cls} {
  display: inline-block;
  line-height: 20px;
  height: 22px;
  padding: 0 8px;
  border-radius: @border-radius-base;
  border: 1px solid @border-color-split;
  background: @background-color-base;
  font-size: @font-size-base;
  transition: all 0.3s @ease-in-out-circ;
  vertical-align: middle;
  opacity: 1;
  overflow: hidden;
  margin: 2px 4px 2px 0;
  cursor: pointer;

  &:hover {
    opacity: 0.85;
  }

  &,
  a,
  a:hover {
    color: @text-color;
  }

  &-text {
    a:first-child:last-child {
      display: inline-block;
      margin: 0 -8px;
      padding: 0 8px;
    }
  }

  .@{iconfont-css-prefix}-cross {
    .iconfont-size-under-12px(10px);
    cursor: pointer;
    font-weight: bold;
    margin-left: 3px;
    color: #666;
    transition: all 0.3s ease;
    opacity: 0.66;

    &:hover {
      opacity: 1;
    }
  }

  &-has-color {
    border-color: transparent;
  }

  &-blue,
  &-green,
  &-yellow,
  &-red {
    &,
    a,
    a:hover,
    .@{iconfont-css-prefix}-cross,
    .@{iconfont-css-prefix}-cross:hover {
      color: #fff;
    }
  }

  &-blue {
    background: @link-color;
  }

  &-green {
    background: @success-color;
  }

  &-yellow {
    background: @warning-color;
  }

  &-red {
    background: @error-color;
  }

  &-close {
    width: 0 !important;
    padding: 0;
    margin: 0;
  }

  &-zoom-enter,
  &-zoom-appear {
    animation: antFadeIn .2s @ease-in-out-circ;
    animation-fill-mode: both;
  }

  &-zoom-leave {
    animation: antZoomOut .3s @ease-in-out-circ;
    animation-fill-mode: both;
  }
}
"

"@import "../../style/themes/default";
@import "../../style/mixins/index";
@import "../../input/style/mixin";

@timepicker-prefix-cls: ~"@{ant-prefix}-time-picker";

.@{timepicker-prefix-cls}-panel {
  max-width: 168px;
  z-index: @zindex-picker;
  position: absolute;

  &-inner {
    display: inline-block;
    position: relative;
    outline: none;
    border: 1px solid @border-color-base;
    list-style: none;
    font-size: 12px;
    text-align: left;
    background-color: #fff;
    border-radius: @border-radius-base;
    box-shadow: @box-shadow-base;
    background-clip: padding-box;
    border: 1px solid #ccc;
    line-height: 1.5;
    overflow: hidden;
  }

  &-input {
    margin: 0;
    padding: 0;
    border: 0;
    width: 100%;
    cursor: auto;
    line-height: 1.5;
    outline: 0;

    &-wrap {
      box-sizing: border-box;
      position: relative;
      padding: 6px;
      border-bottom: 1px solid @border-color-split;
    }

    &-invalid {
      border-color: red;
    }
  }

  &-clear-btn {
    position: absolute;
    right: 5px;
    cursor: pointer;
    overflow: hidden;
    width: 20px;
    height: 20px;
    text-align: center;
    line-height: 20px;
    top: 5px;
    margin: 0;
  }

  &-clear-btn:after {
    font-size: 12px;
    color: #ccc;
    display: inline-block;
    line-height: 1;
    width: 20px;
    transition: color 0.3s ease;
    .iconfont-font("\e62e");
  }

  &-clear-btn:hover:after {
    color: #999;
  }

  &-narrow &-input-wrap {
    max-width: 111px;
  }

  &-select {
    float: left;
    font-size: 12px;
    border: 1px solid @border-color-split;
    border-width: 0 1px;
    margin-left: -1px;
    box-sizing: border-box;
    width: 56px;
    overflow: hidden;
    position: relative; // Fix chrome weird render bug

    &:hover {
      overflow-y: auto;
    }

    &:first-child {
      border-left: 0;
      margin-left: 0;
    }

    &:last-child {
      border-right: 0;
    }

    ul {
      list-style: none;
      box-sizing: border-box;
      margin: 0;
      padding: 0;
      width: 100%;
      max-height: 144px;
    }

    li {
      list-style: none;
      box-sizing: content-box;
      margin: 0;
      padding: 0 0 0 16px;
      width: 100%;
      height: 24px;
      line-height: 24px;
      text-align: left;
      cursor: pointer;
      user-select: none;
      transition: background 0.3s ease;
    }

    li:last-child:after {
      content: '';
      height: 120px;
      display: block;
    }

    li:hover {
      background: tint(@primary-color, 90%);
    }

    li&-option-selected {
      background: @background-color-base;
      font-weight: bold;
    }

    li&-option-disabled {
      color: @btn-disable-color;
      &:hover {
        background: transparent;
        cursor: @cursor-disabled;
      }
    }
  }

  &.slide-up-enter.slide-up-enter-active&-placement-topLeft,
  &.slide-up-enter.slide-up-enter-active&-placement-topRight,
  &.slide-up-appear.slide-up-appear-active&-placement-topLeft,
  &.slide-up-appear.slide-up-appear-active&-placement-topRight {
    animation-name: antSlideDownIn;
  }

  &.slide-up-enter.slide-up-enter-active&-placement-bottomLeft,
  &.slide-up-enter.slide-up-enter-active&-placement-bottomRight,
  &.slide-up-appear.slide-up-appear-active&-placement-bottomLeft,
  &.slide-up-appear.slide-up-appear-active&-placement-bottomRight {
    animation-name: antSlideUpIn;
  }

  &.slide-up-leave.slide-up-leave-active&-placement-topLeft,
  &.slide-up-leave.slide-up-leave-active&-placement-topRight {
    animation-name: antSlideDownOut;
  }

  &.slide-up-leave.slide-up-leave-active&-placement-bottomLeft,
  &.slide-up-leave.slide-up-leave-active&-placement-bottomRight {
    animation-name: antSlideUpOut;
  }
}

.@{timepicker-prefix-cls} {
  position: relative;
  display: inline-block;
  outline: none;
