        position: absolute;
        left: 50%;
        top: 50%;
        z-index: 10;
        -webkit-transition: all 0.3s ease;
        transition: all 0.3s ease;
        cursor: pointer;
        font-size: 16px;
        width: 16px;
        line-height: 1;
        color: #eee;
        opacity: 0;
        margin-top: -8px;
        margin-left: -22px;
        &:hover {
          color: #fff;
        }
      }

      .@{iconfont-css-prefix}-delete {
        left: 50%;
        margin-left: 6px;
      }

      &:hover {
        &:before {
          opacity: .8;
        }

        .@{iconfont-css-prefix}-eye-o,
        .@{iconfont-css-prefix}-delete {
          opacity: 1;
        }
      }
    }

    .@{upload-item}-thumbnail,
    .@{upload-item}-thumbnail img {
      display: block;
      width: 100%;
      height: 100%;
      position: static;
    }

    .@{upload-item}-name {
      display: none;
    }

    .@{upload-item}-uploading {
      &.@{upload-item} {
        background-color: #fbfbfb;
      }

      .@{upload-item}-info {
        height: auto;
        &:before,
        .@{iconfont-css-prefix}-eye-o,
        .@{iconfont-css-prefix}-delete {
          display: none;
        }
      }

      &-text {
        margin-top: 18px;
        color: #999;
      }
    }

    .@{upload-item}-progress {
      padding-left: 0;
    }
  }

  .@{upload-prefix-cls}-success-icon {
    color: @success-color;
    font-weight: bold;
  }

  .@{upload-prefix-cls}-margin-top-enter {
    animation: uploadMarginTopIn .3s @ease-in-out-circ;
  }

  .@{upload-prefix-cls}-margin-top-leave {
    animation: uploadMarginTopOut .3s @ease-in-out-circ;
  }
}

@keyframes uploadMarginTopIn {
  from {
    margin-top: -25px;
    opacity: 0;
  }
}

@keyframes uploadMarginTopOut {
  to {
    margin-top: -25px;
    opacity: 0;
  }
}
